import React from 'react';

function About() {
  return (
    <section className = "about">
        <h1>HELLO, I'M CLARA GILLIGAN</h1>
        <p>I am a UX/UI Designer with a degree in Integrated Digital Media from NYU. IDM is an interdisciplinary major running the gamut of design and technology. I studied Graphic Design, UX Design, Design Thinking, and Web Development. </p>
        <a href = "https://www.petfinder.com/dog-breeds/">Read my resume.</a>
        <a href = "https://www.petfinder.com/dog-breeds/">Take a peek at my Github.</a>
    </section>
  );
}

export default About;
